import React, { Component } from 'react'

export default class favbeaches extends Component {

    render() {

        return (
            <div>
            <div style={{backroundImage:`url("${this.props.displayBeach.photo_1}")`}}
                key={this.props.displayBeach.id} 
                alt={"a beautiful beach"}>
               The Beach You Clicked{this.props.displayBeach.name}</div>
            </div>
           )    
    }
}
